import React, { useState, useEffect } from "react";
import { Article } from "./Article";
import "./Base.css";

export const Base = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    async function getData() {
      const actualData = await fetch(
        "https://www.alphavantage.co/query?function=NEWS_SENTIMENT&tickers=IBM&topics=technology&apikey=3UMZBONPRJC6CCXF"
      ).then((response) => response.json());

      console.log(actualData.feed[0]);
      setData(actualData.feed[0].title);
    }
    getData();
  }, []);

  return (
    <div className="main">
      <h1>heloo</h1>
      <Article data={data} />
    </div>
  );
};
export default Base;
